import React from 'react';
import classes from './Main.module.css';
import bg1 from '../../assets/image_part_001.jpg';
import bg2 from '../../assets/image_part_002.jpg';
import bg3 from '../../assets/image_part_003.jpg';
import bg4 from '../../assets/image_part_004.jpg';

const main = (props) => {
    return (

        <section className={classes.Main}>
            <section className={classes.Content} >
                <div className={classes.img1} style={{backgroundImage:'url(' + bg1 +')'}}>
                    <h3><a href="/">Income Tax</a></h3>
                </div>
                <div className={classes.img2} style={{backgroundImage:'url(' + bg2 +')'}}>
                    <h3><a href="/">GST</a></h3>
                </div>
                <div className={classes.img3} style={{backgroundImage:'url(' + bg3 +')'}}>
                    <h3><a href="/">RBI</a></h3>
                </div>
                <div className={classes.img4} style={{backgroundImage:'url(' + bg4 +')'}}>
                    <h3><a href="/">Contact Us</a></h3>
                </div>
            </section>
            <h1>Firm Name</h1>
            <p>//////////// A Small Description/////////////////</p>
        </section>

    );
}

export default main;
